import React from "react";


const NumericText = ({rows}) => {
    return (
        <section className="columnsText">
            <div className="container">
                <h2>{rows.heading}</h2>
                <div className="columns">
                    return(
                    <section className="numericText">
                        <div className="container">
                            <h2></h2>
                            <div className="text">
                                <div className="item">
                                    <h2 className="number"></h2>
                                    <p></p>
                                </div>
                            </div>
                        </div>
                    </section>
                        )
                </div>
            </div>
        </section>
    );
};

export default NumericText;
